INSERT INTO `gany_tests` VALUES (1,'from testlib import utils\n\nclass NovostroykiMain( utils.PageTest ) :\n    \"Главная страница новостроек\"\n\n    url = u\"http://novostroyki.lun.ua/\"\n    title = u\"Новостройки - ЛУН.ua\"\n','new'),(2,'from testlib import utils\n\nclass PopularBlockLinks( utils.SubTest ) :\n    \"Проверка правильности ссылок в блоке \'Популярные новостройки\'\"\n    __parent_test__ = \"NovostroykiMain\"\n\n    def run(self):\n        popularlink_xpath = \'//*[@id=\"content\"]/div[2]/div[2]/table/tbody/tr/td[1]/span/span/noindex/a\'\n        href = self.webpage.find_element_by_xpath( popularlink_xpath ).get_attribute(\'href\')\n        assert href.startswith( \'http://www.lun.ua/redirect?to=\' ), \'link {0} go not through redirect\'.format( href )\n        assert \"utm_source=lun_ua\" in href, \'utm_source=lun_ua not found for link {0}\'.format( href )\n        assert \"utm_medium=premium_catalog\" in href, \'utm_medium=premium_catalog not found for link {0}\'.format( href )\n        assert \"utm_campaign=novostroyki_premium\" in href, \'utm_campaign=novostroyki_premium not found for link {0}\'.format( href )\n','new'),(3,'from testlib import utils\n\nclass NovostroykiOnMap( utils.PageTest ) :\n    \"Новостройки на карте\"\n\n    url = u\"http://novostroyki.lun.ua/новостройки-на-карте\"\n','new'),(4,'from testlib import utils\n\nclass NovostroykiOfKievRegion( utils.PageTest ) :\n    \"Новостройки киевской области\"\n\n    url = u\"http://novostroyki.lun.ua/новостройки-киевской-области\"\n','new'),(5,'from testlib import utils\n\nclass NovostroykiGoloseevskiy( utils.PageTest ) :\n    \"Новостройки Голосеевского района\"\n\n    url = u\"http://novostroyki.lun.ua/новостройки-голосеевский-район\"\n','new'),(6,'from testlib import utils\n\nclass NovostroykiEconomClass( utils.PageTest ) :\n    \"Новостройки эконом класса\"\n\n    url = u\"http://novostroyki.lun.ua/новостройки-эконом-класса\"\n','new'),(7,'from testlib import utils\n\nclass NovostroykiBusinessClass( utils.PageTest ) :\n    \"Новостройки бизнес класса\"\n\n    url = u\"http://novostroyki.lun.ua/новостройки-бизнес-класса\"\n','new'),(8,'from testlib import utils\n\nclass NovostroykiEliteClass( utils.PageTest ) :\n    \"Новостройки класса элит\"\n\n    url = u\"http://novostroyki.lun.ua/новостройки-элитного-класса\"\n','new'),(9,'from testlib import utils\n\nclass NovostroykiAds( utils.PageTest ) :\n    \"Страница для тех кто заинтересован в рекламе новостроек через ЛУН\"\n\n    url = u\"http://novostroyki.lun.ua/ads\"\n','new'),(10,'from testlib import utils\n\nclass NovostroykiActionsRss( utils.PageTest ) :\n    \"RSS рассылка акций\"\n\n    url = u\"http://novostroyki.lun.ua/акции.rss\"\n','new'),(11,'from testlib import utils\n\nclass NovostroykiActionsRss( utils.PageTest ) :\n    \"RSS рассылка акций\"\n\n    url = u\"http://novostroyki.lun.ua/акции.rss\"\n','new'),(13,'global datetime\nfrom testlib import utils\nimport datetime\n\nclass NovostroykiActionsList( utils.PageTest ) :\n    \"Страница списка всех акций по новостройкам\"\n\n    url = u\"http://novostroyki.lun.ua/акции/\" + str(datetime.date.today().year) + \"/\" + str(datetime.date.today().month)','new'),(14,'from testlib import utils\n\nclass CottageMain( utils.PageTest ) :\n    \"Главная страница котеджей\"\n\n    url = u\"http://cottage.lun.ua/\"\n    title = u\"Коттеджи ЛУН.ua\"\n','new'),(15,'from testlib import utils\n\nclass NovostroykiSearch( utils.PageTest ) :\n    \"Страница поиска новостроек\"\n\n    url = u\"http://novostroyki.lun.ua/поиск-новостроек\"\n','new'),(16,'from testlib import utils\n\nclass CottageSearch( utils.PageTest ) :\n    \"Страница поиска котеджей\"\n\n    url = u\"http://cottage.lun.ua/поиск-коттеджей\"\n','new'),(17,'from testlib import utils\n\nclass CottageOnMap( utils.PageTest ) :\n    \"Котеджи на карте\"\n\n    url = u\"http://cottage.lun.ua/коттеджи-на-карте\"\n','new'),(18,'from testlib import utils\n\nclass NewBuildingPetrovskiyKvartal( utils.