.PageTest ) :\n    \"Страница новостройки ул Фрунзе 85-87а (1170)\"\n\n    url = u\"http://novostroyki.lun.ua/ул-фрунзе-85-87-а-1170\"\n    title = u\"ул. Фрунзе, 85/87-А - жилой комплекс ул. Фрунзе, 85/87-А (г. Киев) - цены, фото, отзывы, форум - Новостройки ЛУН.ua\"\n','new'),(29,'from testlib import utils\n\nclass NewBuilding1170TypeaheadTest( utils.SubTest ) :\n    \"Проверка правильности автокомплита\"\n    __parent_test__ = \"NewBuilding1170\"\n\n    input_xpath = u\'//*[@id=\"search-input\"]\'\n    \n    autocomplete = {\n        u\'голо\' : [\n       		u\'ЖК Голосеево (ул. Голосеевская, 13, Киев)\',\n       		u\'ул. Головатого, 20 (Борисполь)\',\n        	u\'ул. Головацкого/ул. Декарта (Львов)\',\n        	u\'ЖК Лелека (ул. Головатого, 76, Борисполь)\'\n        ],\n    	u\'ху\' : [\n        	u\'ЖК Дом с Ротондами (ул. Сухумская, Харьков)\'\n        ]\n    }','new'),(30,'from testlib import utils\n\nclass NovostroykiOnMapTypeahead( utils.TypeaheadTest ) :\n    \"Проверка правильности автокомплита новостроек на карте \"\n    __parent_test__ = \"NovostroykiOnMap\"\n\n    input_xpath = u\'//*[@id=\"search-input\"]\'\n    \n    autocomplete = {\n        u\'голо\' : [\n       		u\'ЖК Голосеево (ул. Голосеевская, 13, Киев)\',\n       		u\'ул. Головатого, 20 (Борисполь)\',\n        	u\'ул. Головацкого/ул. Декарта (Львов)\',\n        	u\'ЖК Лелека (ул. Головатого, 76, Борисполь)\'\n        ],\n    	u\'ху\' : [\n        	u\'ЖК Дом с Ротондами (ул. Сухумская, Харьков)\'\n        ]\n    }','new'),(31,'from testlib import utils\n\nclass NovostroykiGoloseevskiyCoutner( utils.CounterTest ) :\n    \"Проверка районов новостроек на странице Голосеевского района\"\n    __parent_test__ = \"NovostroykiGoloseevskiy\"\n\n    texts = [\n    	[u\'Киев, Голосеевский\', \'=\', 25]        \n    ]','new'),(32,'from testlib import utils\n\nclass NovostroykiEconomClassCounter( utils.CounterTest ) :\n    \"Проверка класса новостроек на странице новостроек класса эконом\"\n    __parent_test__ = \"NovostroykiEconomClass\"\n\n    texts = [\n        [ u\'эконом\', u\'>=\', 26 ]\n    ]','new'),(33,'from testlib import utils\n\nclass NoKievBuildingsInKievRegion( utils.CounterTest ) :\n    \"Нету киевских новостроек\"\n    __parent_test__ = \"NovostroykiOfKievRegion\"\n\n    texts = [\n        [u\'Киев \', u\'<=\', 1]\n    ]','new'),(34,'from testlib import utils\n\nclass DistrictsLoadOnCitySelect( utils.LoadOnSelectTest ) :\n    \"Проверка подгрузки районов при выборе города\"\n    __parent_test__ = \"NovostroykiMain\"\n\n    select_xpath = u\"//*[@id=\'city\']\"\n    loaded_element_xpath = u\"//*[@id=\'district\']\"\n\n    select = [\n        [\n            u\'Киев (414)\',\n            [u\'Голосеевский\', u\'Дарницкий\', u\'Деснянский\',\n             u\'Днепровский\', u\'Оболонский\', u\'Печерский\',\n             u\'Подольский\', u\'Святошинский\', u\'Соломенский\',\n             u\'Шевченковский\']\n        ],\n    	[\n         	u\'Донецк (30)\',\n            [u\'Ленинский\',u\'Киевский\',u\'Пролетарский\',\n             u\'Куйбышевский\',u\'Ворошиловский\',u\'Калининский\',\n             u\'Петровский\',u\'Кировский\',u\'Буденновский\']\n        ]\n    ]\n','new');
